import './App.css';
import {useState, useMemo} from 'react'
import Header from './components/Header';


function App() {
  const [number, setNumber] = useState(0);

  return (
    <div className="App">
      <Header />
      <hr />
      <h1>{number}</h1>
      <button onClick={() => setNumber(number + 1)}>Click</button>

    </div>
  );
}

export default App;
